export const initialValue = {
    mainPosts: [
        {
            id: 1,
            User: {
                id: 1,
                nickname: "이현철",
            },
            content: "첫 번째 게시글 #해시태그 #익스프레스",
            Images: [
                {
                    srd: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fnamu.wiki%2Fw%2F%25EB%25AF%25B8%25EB%2585%25B8%25EC%259D%25B4%3Frev%3D136&psig=AOvVaw3seW_-N3EDLynDHGqVRvJx&ust=1695042187804000&source=images&cd=vfe&opi=89978449&ved=0CBAQjRxqFwoTCOD6zK7asYEDFQAAAAAdAAAAABAE",
                },
            ],
        },
    ],
};

const reducer = (state = initialValue, action) => {
    switch (action.type) {
        default:
            return state;
    }
};

export default reducer;
